import * as api from "../api";

//Action creators

export const getPasswords = () => async(dispatch) => {
    try {
        const { data } = await api.fetchPasswords();
        dispatch({type: 'FETCH_ALL', payload:data});
    } catch (error) {
        console.log(error)
    }
    const action = {type: 'FETCH_ALL', payload:[]}
    dispatch(action);
}
